package com.example.entity;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import java.util.UUID;@Entity@Table(name = "article_type")@Data@AllArgsConstructor@NoArgsConstructorpublic class ArticleTypeEntity extends BaseStringEntity{    @Column(name = "order_number")    private Integer orderNumber;    @Column(name = "name_uz",            nullable = false,            unique = true)    private String nameUz;    @Column(name = "name_ru",            nullable = false,            unique = true)    private String nameRU;    @Column(name = "name_en",            nullable = false,            unique = true)    private String nameEN;    @Column    private Long prtId;}